export default function Contact(){
    return (
    <div className="ContactUs">
        <h1>Contact</h1>
        <label for="number">Type your number: </label><br />
        <input type="number" name="number" placeholder="number" /><br />
        <a href="tel:123456">Or even call me!</a><br />
        <a href="mailto:ahuseynova11989@ada.edu.az">Or email me!</a>


    
    
    </div>
    )
}
